import React from "react";
import image from "./pokemon_project.png";
import "./HomeMenu.css";

const HomeMenu = () => {
  return (
    <div className="home-content">
      <img className="game-image" src={image} alt="game_image" />
      <div className="home-text">Hi! I'm Ramil Christian L. Atangan</div>
    </div>
  );
};

export default HomeMenu;
